import { Link } from "react-router-dom";

const DUMMY = [
  {
    id: "e1",
    title: "Event 1",
  },
  {
    id: "e2",
    title: "Event 2",
  },
  {
    id: "e3",
    title: "Event 3",
  },
];

function EventsPage() {
  return (
    <div>
      <h1>EventsPage</h1>
      <ul>
        {DUMMY.map((event) => (
          <li key={event.id}>
            <Link to={"event.id"}>{event.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default EventsPage;
